import React from 'react'
import Link from 'next/link'
import List from '../components/List'

const DetailLink = props => (
  <Link href="/[id]" as={`/${props.id}`}>
    <a>{props.id}</a>
  </Link>
)

export default function Index() {
  return (
    <div>
      <List />
      <DetailLink id="teste-detalhe" />
    </div>
  )
}
